    if ( this.avoirDocument.achat === 'Achat' ) {


      this.authorizationService.getFournisseurById(this.avoirDocument.personId).subscribe(
        data => {
          this.nomSociete = data.nomSociete;
          this.nomPrenom =data.nom+" "+data.prenom;
          this.ville=data.ville;
          this.adresse=data.adresse;
        }, err => {
        });
    }else {
      this.authorizationService.getClientById(this.avoirDocument.personId).subscribe(
        data => {
          this.nomSociete = data.nomSociete;
          this.nomPrenom =data.nom+" "+data.prenom;
          this.ville=data.ville;
          this.adresse=data.adresse;
        }, err => {

        });
    }
    doc.setFont('times');
    doc.setFontType('italic');
    doc.text(this.nomSociete, 122, 50);

    doc.setFont('times');
    doc.setFontType('italic');
    doc.text(this.nomPrenom, 122, 57);

    doc.setFont('times');
    doc.setFontType('italic');
    doc.text(this.ville, 122, 63);


    doc.setFont('times');
    doc.setFontType('italic');
    doc.text(this.adresse, 122, 70);



    doc.setFont('helvetica');
    doc.setFontType('bold');
    doc.setFontType('italic');
    doc.text('Avoir N° ' + this.avoirDocument.ref, 90, 90)


// Filled red square
    doc.setDrawColor(0)
    doc.setFillColor(0, 0, 255)
    doc.rect(10, 100, 190, 10, 'F')

// Black sqaure with rounded corners
    doc.setDrawColor(0, 0, 255)
    doc.setFillColor(255, 255, 255)
    doc.rect(10, 110, 190, 150, 'FD')

    doc.setDrawColor(0, 0,255)
    doc.setLineWidth(0.1)
    doc.line(100, 260, 100, 110) // vertical line

    doc.setDrawColor(0, 0,255)
    doc.setLineWidth(0.1)
    doc.line(120, 260, 120, 110) // vertical line
    doc.setDrawColor(0, 0,255)
    doc.setLineWidth(0.1)
    doc.line(140, 260, 140, 110) // vertical line
    doc.setDrawColor(0, 0,255)
    doc.setLineWidth(0.1)
