    doc.setLineWidth(0.1)
    doc.line(180, 260, 180, 110) // vertical line

    doc.setTextColor(255)
    doc.setFont('courier')
    doc.setFontType('bolditalic')
    doc.text('References de Produits', 13, 105)


    doc.setTextColor(255)
    doc.setFont('courier')
    doc.setFontType('bolditalic')
    doc.text('Qte', 103, 105)


    doc.setTextColor(255)
    doc.setFont('courier')
    doc.setFontType('bolditalic')
    doc.text('PuHT', 123, 105)

    doc.setTextColor(255)
    doc.setFont('courier')
    doc.setFontType('bolditalic')
