    doc.setTextColor(255)
    doc.setFont('courier')
    doc.setFontType('bolditalic')
    doc.text('TotalHT', 163, 105)

    doc.setTextColor(255)
    doc.setFont('courier')
    doc.setFontType('bolditalic')
    doc.text('TotalTTC', 182, 105)

    doc.setTextColor(0)

    doc.setFont('times');
    doc.setFontType('italic');
    doc.setFontSize(10)
    const date = new Date();
    doc.text('Tunis Le ' + date.getDate()+'/'+(date.getMonth()+1)+'/'+date.getFullYear(), 170, 75);
    let y = 115;
    this.source.forEach(ligne => {
      y = y + 6;
      var x = 13;
      doc.setTextColor(0);
      doc.setFont('courier');
      doc.setFontType('bolditalic');

      doc.text(ligne.code, x, y);
      x = 103;
      doc.setFont('courier');
      doc.setFontType('bolditalic');
      doc.text(ligne.qte+'', x, y);

      x = x+20;
      doc.setFont('courier');
      doc.setFontType('bolditalic');
      doc.text(ligne.puHT+'', x, y);
      x = x+20;
      doc.setFont('courier');
      doc.setFontType('bolditalic');
      doc.text(ligne.reduction+'', x, y);
      x = x+20;
      doc.setFont('courier');
      doc.setFontType('bolditalic');
      doc.text(ligne.totalHT+'', x, y);

      x = x+20;
      doc.setFont('courier');
      doc.setFontType('bolditalic');
      doc.text(ligne.totalTTC+'', x, y);
    });



    doc.setDrawColor(0, 0, 255)
    doc.setFillColor(255, 255, 255)
    doc.roundedRect(120, 265, 85, 30, 3, 3, 'FD')

    doc.setFont('courier');
    doc.setFontType('bolditalic');
    doc.text('TotalHT : '+this.avoirDocument.documenttotalHT+'', 122, 273);


    doc.setFont('courier');
